  const svgEl = useRef(null)
  const [inView, setInView] = useState(false)

  useEffect(() => {
    const tl = gsap.timeline({
      scrollTrigger: {
        trigger: svgEl.current,
        toggleActions: 'play pause resume reset',
        onUpdate: ({ isActive }) => setInView(isActive),
      },
      defaults: {
        duration: 25,
        repeat: -1,
        ease: 'none',
      },
    })

    const orbit1MotionPath = {
      path: '#EcoSystem__orbit-1',
      align: '#EcoSystem__orbit-1',
      alignOrigin: [0.5, 0.5],
    }

    const orbit2MotionPath = {
      path: '#EcoSystem__orbit-2',
      align: '#EcoSystem__orbit-2',
      alignOrigin: [0.5, 0.5],
    }

    const planets = [
      '#EcoSystem__planet-3',
      '#EcoSystem__planet-4',
      '#EcoSystem__planet-5',
      '#EcoSystem__planet-6',
      '#EcoSystem__planet-8',
      '#EcoSystem__planet-9',
    ]

    planets.forEach((planet, index) => {
      const isEven = index % 2 === 0
      const orbit = isEven ? orbit1MotionPath : orbit2MotionPath
      const offset = isEven ? 0.1 : 0
      const start = (1 / planets.length) * index + offset
      const end = start + 1

      tl.to(
        planet,
        { motionPath: { ...orbit, start, end }, reversed: isEven },
        0
      )
    })
  }, [])

